/* History */The inclusion of 'believed to be' in its previous position was counter to its following sentence which states it as factual.
It has been replaced to a latter space in the sentence.

Central Asia was also changed to [[Central Asia]]

/* Etymology */There is no evidence, even in Parvati's page, to the usage of Arya as a name.

The following was removed:

Some Hindu scriptures refer to the Hindu goddess [[Parvati]] as Arya.<ref>{{cite book|title=India through the ages|last=Gopal|firs...
